// index.js
import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';
import './index.css';
import App from './App';
import CategoryBox from './CategoryBox'; // CategoryBox 임포트
import reportWebVitals from './reportWebVitals';

ReactDOM.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

// CategoryBox 컴포넌트를 category 아이디를 가진 div에 렌더링
ReactDOM.render(
  <React.StrictMode>
    <CategoryBox />
  </React.StrictMode>,
  document.getElementById('category')
);

reportWebVitals();
